import React, { useRef, useEffect, useState, useCallback } from "react";
import { useGlobalState } from "../context/globalContext";
import animationData from "../assets/volcana.json";
import mojs from "@mojs/core";
import Lottie from "react-lottie";
const Volcano = ({ earthRef }) => {
  const { volcanoPosition } = useGlobalState();

  const defaultOptions = {
    loop: true,
    autoplay: true,
    animationData: animationData,
    rendererSettings: {
      preserveAspectRatio: "xMidYMid slice",
    },
  };

  // Update the animation values when the prop changes

  console.log(volcanoPosition);
  return (
    <div
      className="Volcano"
      style={{
        position: "absolute",
        top: volcanoPosition.y,
        left: volcanoPosition.x,
      }}
    >
      {volcanoPosition !== null && volcanoPosition !== undefined ? (
        <Lottie options={defaultOptions} height={100} width={100} />
      ) : null}
    </div>
  );
};

export default Volcano;
